import React,{setState} from 'react';
import SubComponent from './subComponent';

function setStateComponent(){
    const [count] = setState(0)
    return(
        <div>
            <p>{count}</p>
            <button type="button" onClick={() => alert("Hello")}>Increment</button>
        </div>
    )
}

class MainComponent extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            client:{
                name:"",
                age: "",
                qualification: ""
            },
            employee:{
                name:"",
                age: "",
                address: ""
            }
        }        
    }
    componentDidMount(){
        this.sendDataToChild();
    };
    sendDataToChild = () =>{
        this.setState({
            client:{
                name:"Pinky",
                age: 20,
                address: "10 + 2"
            }
        })
    }
    callBackFunction = (data) =>{
        this.setState({
            employee:{
                name:data.name,
                age: data.age,
                address: data.address
            }
        })
    }
    render(){
        return(
            <div>
                <SubComponent clientDetails={this.state.client} callBackFunction = {this.callBackFunction}/>
                <p>{this.state.employee.name}</p>
                <p>{this.state.employee.age}</p>
                <p>{this.state.employee.qualification}</p>
                <setStateComponent/>
            </div>
        )
    }
}

export default MainComponent
